import { FaHeart} from "react-icons/fa";
import "./music.css"

class Music extends Component {
    render() {
        return (
                <div className="wrapper">
                    <div className="player">

                                    <div id="nowPlay">
                                        <span id="npAction">Paused...</span><span id="npTitle"></span>
                                    </div>


                    </div>
                </div>
        )
    }
}


export default Music;
